“POR QUÉ TE QUIERO TANTO” ESTÁ DISPONIBLE YA YA YA YA 🥹❤️
Me tocó ser su primera nieta y compartir millones y millones de momentos. La vi sufrir por mi sufrimiento, emocionarse por mis alegrías, enorgullecerse de mis canciones, salirse de sí misma para entenderme, quererme, y apoyarme siempre. Merece mucho más que una canción, pero me pareció una linda manera de inmortalizar todo lo que nos queremos, hemos querido y querremos siempre ❤️ Esta va para mi abuela Lía y la cantamos a los gritos este sábado en Niceto, están?

